<?php
session_start();

function ajouterTerrariumCustomAuPanier($quantite, $price, $composants)
{
    $_SESSION['panier'][-1] = array(
        'id' => -1,
        'nom' => 'Terrarium personnalisé',
        'quantite' => $quantite,
        'price' => $price,
        'composants' => $composants);

}

// Ajout du terrarium personnalisé dans le panier
if (isset($_POST['base']) && isset($_POST['substrat']) && isset($_POST['plants']) &&
    isset($_POST['quantite'])) {

    $composants = array(
        "base" => $_POST['base'],
        "substrat" => $_POST['substrat'],
        "plants" => $_POST['plants']
    );

    ajouterTerrariumCustomAuPanier($_POST['quantite'], 50, $composants);
}

